import Navbar from "./";
import About from "./About";
import Plan from "./Plan";
import Work from "./Work";
import Social from "./Social";
import Footer from "./Footer";
import './App.css';
function App() {
  return (
    <>
    <Navbar/>
    <About/>
    <Plan/>
    <Work/>
    <Social/>
    <Footer/>
    </>
  );
  }
export default App;
